import React from 'react';

import Cell from './Cell';

// 'stage' is a multi dimensional array
const Stage = ({stage}) => (
    <div>
        {stage.map(row => row.map((cell, x) => <Cell key={x} type={cell[0]}/>))}
    </div>
)

export default Stage;
